import { Route, Routes, Router } from 'react-router-dom';
import './App.css';
import Layout from "./components/Layout";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Layout />}>
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
